<?php

namespace app\controllers;

use Yii;
use yii\web\Controller;
use yii\web\Response;
use app\helpers\Image;

class SiteController extends Controller
{
    /**
     * {@inheritdoc}
     */
    public function actions()
    {
        return [
            'error' => [
                'class' => 'yii\web\ErrorAction',
            ],
        ];
    }

    /**
     * Displays homepage.
     *
     * @return string
     */
    public function actionIndex()
    {
        if (Yii::$app->request->isPost) {
            if (Yii::$app->request->post('btn') === 'submit') {
                $str = Yii::$app->request->post('imgStr');
                $select = Yii::$app->request->post('imgSelect');

                if (!Image::validateString($str)) {
                    return $this->render('render', [
                        'imgSelect' => $select,
                        'imgStr' => $str,
                    ]);
                }

                $resArr = Image::convertImg($select . str_pad($str, 104856, '0', STR_PAD_RIGHT));

                $img = imagecreatetruecolor(256, 256);
                $x = 0;
                $y = 0;

                foreach ($resArr as $val) {
                    if ($x === 256) {
                        $x = 0;
                        $y++;
                    }

                    imagesetpixel($img, $x, $y, Image::getColor($img, $val));
                    $x++;
                }

                ob_start();
                imagepng($img);
                Yii::$app->response->data = ob_get_clean();
                ob_end_clean();

                imagedestroy($img);

                Yii::$app->response->format = Response::FORMAT_RAW;
                Yii::$app->response->headers->add('Content-type', 'image/png');
                return Yii::$app->response;
            }

            if (Yii::$app->request->post('btn') === 'random') {
                return $this->render('render', [
                    'imgSelect' => str_pad(Image::base32_encode(rand(0, 255)),  2, '0', STR_PAD_LEFT),
                    'imgStr' => Image::getRandomString(),
                ]);
            }
        } else {
            $imgSelect = '57';
            $imgStr = '';

            return $this->render('render', [
                'imgSelect' => $imgSelect,
                'imgStr' => $imgStr,
            ]);
        }
    }

    /**
     * Displays about page.
     *
     * @return string
     */
    public function actionAbout()
    {
        return $this->render('about');
    }
}
